#include <iostream>
#include <vector>
#include <algorithm>
#include <utility>

using namespace std;

struct Frame {
    int x1, y1, x2, y2;
    int order;
};

bool compareFrames(const Frame& a, const Frame& b) {
    if (a.x2 == b.x2) {
        return a.y1 < b.y1;
    }
    return a.x2 > b.x2;
}

void solve() {
    int n;
    cin >> n;
    vector<Frame> frames(n);
    for (int i = 0; i < n; i++) {
        cin >> frames[i].x1 >> frames[i].y1 >> frames[i].x2 >> frames[i].y2;
        frames[i].order = i + 1;
    }

    sort(frames.begin(), frames.end(), compareFrames);

    vector<int> read(n, 0);
    int x = frames[0].x2;
    int y = frames[0].y1;
    int i = 1;
    while (i < n) {
        while (i < n && frames[i].x2 <= x) {
            i++;
        }
        if (i < n) {
            int minY = frames[i].y1;
            while (i < n && frames[i].x2 == x) {
                if (frames[i].y1 < minY) {
                    minY = frames[i].y1;
                }
                i++;
            }
            if (i < n) {
                int maxY = frames[i - 1].y2;
                while (i < n && frames[i].x2 == x && frames[i].y1 <= maxY) {
                    read[frames[i].order - 1] = 1;
                    i++;
                }
            }
        }
        x = frames[i - 1].x2;
        y = frames[i - 1].y1;
    }

    for (int i = 1; i <= n; i++) {
        if (read[i - 1]) {
            cout << i << endl;
        }
    }
    cout << endl;
}

int main() {
    int t;
    cin >> t;
    while (t--) {
        solve();
    }
    return 0;
}
